task.summary:
Aplicativo Android desenvolvido para a disciplina de Programao para Dispositivos Mveis. 

No primeiro acesso, o usurio dever fazer SignUp para se cadastrar no sistema. Em seguida, ter acesso ao sistema como usurio(vendedor) comum (sem privilgio de administrador) e poder gerenciar ordens de servio e equipamantos, mas no poder cadastrar um novo cliente; 
Como regra, somente o admin, ter acesso ao cadastramento de Clientes na navbar(esta verificao  feita na 'OsActivity' linhas 71 e 72);
exemplo de usurio administrador j cadastrado: usuario: 'admin@admin.com', senha: '123456'; para definir um novo administrador, dever ser feita alterao manualmente no n User no firebase, definindo funo 'admin' para o usurio desejado.
Os passos de utilizao aps o Login so:
1. Cadastrar(se administrador) ou selecionar um cliente;
2. Na navbar, Cadastrar o equipamento desejado e selecionar um cliente ao qual o equipamento pertence;
3. Na navbar, Cadastrar uma OS clicando em OS, selecione um equipamento para vincular  OS;
4. Alteraes nos registros podero ser feitas  medida em que a OS sofrer alteraes.

--> Controladores:
OsActivity - IMPLEMENTADO;
EquipamentoActivity - IMPLEMENTADO;
ClientesActivity - IMPLEMENTADO - obs.: Trecho Clientes foi Adaptado do Professor;
LoginActivity - IMPLEMENTADO;
--> Desafios: 
Notificaes - IMPLEMENTADO;
SignUP - IMPLEMENTADO;

